let ShowYAxisLabelInstance = null;
module.exports = class ShowYAxisLabel {

    constructor() {
        if (!ShowYAxisLabelInstance) {
            ShowYAxisLabelInstance = this;
            //set all other default values

            this.displayAs = 'Show Y-Axis Label';
            this.value = '[showYAxisLabel]'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return ShowYAxisLabelInstance;
    }
}